import React from 'react';
import NavBar from "./NavBar";
import Home from "./Home";
import Contact from "./Contact";
import About from "./About";

import { BrowserRouter, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
    <Switch>
      <NavBar />
      <div className="container-fluid">

          <Route exact="true" to path="/" element={<Home />} />
          <Route exact="true" path="/register" element={<Contact/>} />
          <Route exact="true" path="/dashboard" element={<About/>} />


      </div>
      </Switch>
      </BrowserRouter>

  );
}

export default App;
